import React, {Component} from 'react';
import {ListGroup, ListGroupItem} from 'reactstrap';
class Category extends Component {
    constructor(props) {
        super(props);
        state : {};
    }
    render() {
        return (
            <div className="category">
                <h3>{this.props.title}</h3>
                <ListGroup className="category bg-dark">
                    <ListGroupItem className="items2"><a href="" className="links2">Lorem ipsum dolor.</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">Animi dolorem, velit.</a></ListGroupItem><ListGroupItem className="items2"><a href="" className="links2">Ex, raesentium tenetur!</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">Eveniet, maxime, porro.</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">A, eius, optio!</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">Aliquid, necessitatibus, quas.</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">Essipsam, nam.</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">Aliquam expedita, ratione?</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">Error,iste rerum.</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">Eveniet, nam saepe!</a></ListGroupItem>
                </ListGroup>
            </div>
        );
    }
}

export default Category;
